import React from 'react';

const Navbar = (props) => {
    return (
        <>
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand href="#home">
                <img
                    alt=""
                    src="/logo.svg"
                    width="30"
                    height="30"
                    className="d-inline-block align-top"
                />{' '}
                Shoppies
                </Navbar.Brand>
            </Navbar>
        </>
    );
};

export default Navbar;
